I found the issue! Your function is missing the 'async' keyword and 'await' operators. Here's the corrected version:

```javascript
async function getData() {
  const response = await fetch('https://api.example.com/data');
  const result = await response.json();
  return result;
}
```

The key changes:
1. Added 'async' before 'function'
2. Added 'await' before 'fetch()'
3. Added 'await' before 'response.json()'
4. Split into two steps to properly await both promises
